pragma solidity ^0.8.0;
import "../../../interfaces/ICertifiers.sol";


contract Certifiers is ICertifiers {

    address[] private _trustedcertifiers;

    function isTrustedCertifier(address certifier_) public view virtual returns (bool) {
        if (certifier_ == address(this)) return true;
        uint i = _trustedcertifiers.length;
        for (;i>0;i--)
             if (_trustedcertifiers[i-1]==certifier_)
                return true;
        return false;
    }

    function trustedCertifierAdded(address certifier_) internal virtual {}

    function trustedCertifierRemoved(address certifier_) internal virtual {}

    function _addTrustedCertifier(address certifier_) internal returns (bool){
        uint i = _trustedcertifiers.length;
        for (;i>0;i--)
            if (_trustedcertifiers[i-1]==certifier_)
                return false;
        _trustedcertifiers.push(certifier_);
        trustedCertifierAdded(certifier_);
        return true;
    }
    function _removeTrustedCertifier(address certifier_) internal  returns (bool){
        uint _len = _trustedcertifiers.length;
        for (uint i;i<_len;i++)
            if (_trustedcertifiers[i]==certifier_)
            {
                if (i<_len-1)
                    _trustedcertifiers[i] = _trustedcertifiers[_len-1];
                _trustedcertifiers.pop();
                trustedCertifierRemoved(certifier_);
                return true;
            }
        return false;
    }


    function supportsInterface(bytes4 interfaceId)
        public
        view virtual
        returns (bool)
    {
        return interfaceId == type(ICertifiers).interfaceId;
    }

}
